  type RootMutation {
    addPost (
      post: PostInput!
      user: UserInput!
    ): Post
  }

  type RootQuery {
    posts: [Post]
  }

  schema {
    query: RootQuery
    mutation: RootMutation
  }
`;

export default [typeDefinitions];
